  \"2013-03-15T09:04:57.494432\",\n\t\"name\": \"accuracy-assessment-points-for-wind-cave-national-park-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The accuracy assessment field work was
  performed to verify the accuracy of the vegetation communities spatial data developed
  by the USGS-NPS Vegetation Mapping Program for Wind Cave National Park. The data
  points were stratified according to vegetation association over the project area
  according to protocols developed by the Program. Points were located by GPS navigation
  and the community information was collected at the point, without knowledge of the
  attributes of the vegetation spatial data. Accuracy assessment attribute were composed
  with the map codes and a contigency table was developed.\",\n\t\"license_title\":
